import React from 'react'
import spinner from '../../img/spinner.gif'

export const CharacterGrid = ({ characters, isLoading }) => {
    {/* turnary, if if loading, show loading wheel, else...*/ }
    return isLoading ? (<img src={spinner} alt="spinner"></img>) : (<section className="cards">
        {characters.map((character, i) => (
            <h1 key={i}>{character[0]}</h1>
        ))}
    </section>)
}
